import Vue from 'vue'
import VueRouter from 'vue-router'
import App from './App.vue'
import vuetify from './plugins/vuetify'

Vue.component('Principal',require('/src/Principal.vue').default);
Vue.use(VueRouter)



const router = new VueRouter({
  routes:  [
    {
      path: '/',
      name: 'carga',
      component: () => import('/src/views/Carga.vue')
    },
    {
      path:'/',
      name:'home',
      component: () => import('/src/App.vue')
    }
  
  ]
})
  
Vue.config.productionTip = false

new Vue({
  router,
  vuetify,
  render: h => h(App)
}).$mount('#app')
